import Signup from "./Signup";
import Login from "./Login";
import Navbar from "./Navbar";
import Services from "./Services";
import ContactForm from "./ContactForm";

function Home({ user }) {
  return (
    <div>
      <Navbar user={user} />

      {/* Renderizar todas las páginas debajo de la barra de navegación */}
      <Services />
      <ContactForm />
    </div>
  );
}

export default Home;
